import React from 'react'
import { Routes, Route, BrowserRouter, Navigate } from "react-router-dom";
import { PageCliente } from '../pages/PageCliente';
import { Login } from '../login/Login';
import { Layout } from '../Layout/Layout';
import { PageOT } from '../OT/PageOT';
import { FormularioOT } from '../OT/FormularioOT';
import { UserProvider, useUser } from '../usuario/UsuarioContexto';

const PrivateRoute = ({ children }) => {
  const { user } = useUser();

  if (!user) {
    return <Navigate to="/" />;
  }
  return children
};


export const ArsheepRouter = () => {
  return (
    <div className="content-browser">
      <UserProvider>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/Layout/*" element={<PrivateRoute><Layout /></PrivateRoute>}>
              <Route path="Clientes" element={<PrivateRoute><PageCliente /></PrivateRoute>} />
              <Route path="OT" element={<PrivateRoute><PageOT /></PrivateRoute>} />
              <Route path="Formulario" element={<PrivateRoute><FormularioOT /></PrivateRoute>} />
            </Route>
            <Route path="*" element={<><h1>Error 404</h1><strong>Esta PÃ¡gina no existe</strong></>} />
          </Routes>
        </BrowserRouter>
      </UserProvider>
    </div>
  );
};
export default ArsheepRouter;
